import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';
import { Roles } from '../Models/Roles.models';
import { UserLogin, UserRegister, UserResponse } from '../Models/User.Models';

import { Observable, throwError } from 'rxjs';
import { catchError } from 'rxjs/operators';

import { environment } from 'src/environments/environment';
import { ApiResponse } from '../Models/ApiResponse.models';

@Injectable({
    providedIn: 'root'
})
export class UserServices {

    constructor(private http: HttpClient) { }

    getRoles(): Observable<Roles[]> {
        return this.http.post<Roles[]>(`${environment.Api_url}/Admin`, null)
            .pipe(catchError(error => {
                //console.log('Error en la solicitud:', error);
                return throwError(() => new Error(error));
            }));
    }

    Register(data: UserRegister): Observable<ApiResponse<UserResponse>> {
        return this.http.post<ApiResponse<UserResponse>>(`${environment.Api_url}/Authentication/login`, data)
            .pipe(catchError(error => {
                return throwError(() => new Error(error));
            }))
    }

    Login(data: UserLogin): Observable<ApiResponse<UserResponse>> {
        return this.http.post<ApiResponse<UserResponse>>(`${environment.Api_url}/Authentication/register`, data)
    }

}
